def separate_paren_groups(paren_string: str) -> List[str]:
    result = []
    count = 0
    current_group = ''
    for char in paren_string:
        if char == '(':
            count += 1
            current_group += char
        elif char == ')':
            count -= 1
            current_group += char
            if count == 0:
                result.append(current_group)
                current_group = ''
    return result

def below_zero(operations: List[int]) -> bool:
    balance = 0
    for operation in operations:
        balance += operation
        if balance < 0:
            return True
    return False

